const colors = [
    {title: '红色', colors: [' #94070A', ' #FA7F6F', ' #CE4942']},
    {title: '橙黄', colors: [' #f8f1e3', ' #FFD1B0', ' #f7dc9c', ' #EE8A12', ' #F66809']},
    {title: '绿色', colors: [' #eaefdb', ' #a4bf90', ' #6FAC46']},
    {title: '蓝色', colors: [' #F0F6FF', ' #eaf5fa', ' #C8D7EF', ' #C1D3D9', ' #8dafca', ' #82B0D2']},
    {title: '紫色', colors: [' #f5eef7', ' #BEB8DC', ' #a48197']},
    {title: '米色', colors: [' #E7DAD2']},
    {title: '灰色', colors: [' #999999']}
];




.color-grid{
  display:grid;
  grid-template-columns:repeat(auto-fill,minmax(120px,1fr));
  gap:1rem;
  max-width:960px;margin:auto;
}
.color-item{
  cursor:pointer;
  text-align:center;
  border-radius:6px;
  overflow:hidden;
  box-shadow:0 1px 4px rgba(0,0,0,.1);
  transition:transform .15s;
  font-size:.9rem;
}
.color-item:hover{ transform:translateY(-2px); }
.swatch{ display:block;height:80px; }
.code{ display:block;padding:.5rem;font-family:monospace; }
.toast{
  position:fixed;bottom:2rem;left:50%;
  transform:translateX(-50%);
  background:#000;color:#fff;
  padding:.4rem .8rem;border-radius:4px;font-size:.8rem;opacity:.85;
  z-index:9999;
}




// 渲染网格
const palette = document.getElementById('palette');
colors.forEach((group, groupIndex) => {
  // 为每个颜色组创建一个容器
  const container = document.createElement('div');
  container.style.marginBottom = '2rem';

  // 添加标题
  const title = document.createElement('h2');
  title.textContent = group.title;
  title.style.marginBottom = '1rem';
  title.style.fontSize = '1.2rem';
  title.style.fontWeight = '600';
  container.appendChild(title);

  // 创建颜色网格
  const colorGrid = document.createElement('div');
  colorGrid.className = 'color-grid';

  // 渲染该组内的所有颜色
  group.colors.forEach(color => {
    color = color.replace(' ', '');
    const el = document.createElement('div');
    el.className = 'color-item';
    el.dataset.code = color;
    el.innerHTML =
      `
       ${color}`;
    colorGrid.appendChild(el);
  });

  container.appendChild(colorGrid);
  palette.appendChild(container);
});

// 复制功能
document.addEventListener('click', e=>{
  const item = e.target.closest('.color-item');
  if(!item) return;
  const code = item.dataset.code;
  copyText(code).then(()=>toast(`已复制 ${code}`));
});

function copyText(text){
  // 现代浏览器
  if(navigator.clipboard){
    return navigator.clipboard.writeText(text);
  }
  // 降级方案
  return new Promise(res=>{
    const ta = document.createElement('textarea');
    ta.value = text; document.body.appendChild(ta);
    ta.select(); document.execCommand('copy');
    document.body.removeChild(ta); res();
  });
}

function toast(msg){
  const t = document.createElement('div');
  t.className='toast'; t.textContent=msg;
  document.body.appendChild(t);
  setTimeout(()=>t.remove(),1500);
}
